import React from 'react';
import logo from './logo.svg';
import './App.css';

let rowLimit = 25;

class App extends React.Component {
	constructor( props ){
		super( props );  
		this.state = {
			data: []
		};
	}	

	render() {
		const rows = []
		for ( let i = 0; i < rowLimit; i++ ) {
			rows.push( <Row data={this.state.data[i]} /> )
		};
		return <table className="launchTable">
			<Row header={true} > </Row>
			{ rows }
		</table>
	}

	componentDidMount() {
		fetch("https://api.spacexdata.com/v3/launches")
		.then(response => response.json())
		.then(data => this.setState({ data }));
	}
}

let tableHeader = <tr> 
					<th> Mission </th> 
					<th> Date </th> 
					<th> Flight # </th> 
					<th> Rocket </th> 
					<th> Cargo </th>
					<th> Launch Success </th>
				</tr>

class Row extends React.Component {
	constructor( props ){
		super( props );  
		this.state = {
			data: []
		};
	}

	render() {
		if ( this.props.header ) return tableHeader;
		if ( this.props.data ) {
			const data = this.props.data
			return <tr>
						<td> { missionName( data ) } </td>
						<td> date </td>
						<td> { flightNum( data ) } </td>
						<td> { rocketName( data ) } </td>
						<td> { cargo( data ) } </td>
						<td> { launchSuccess( data ) } </td>
					</tr>
		}
		return "loading";
	}
}

function missionName( data ) {
	return data.mission_name
}

function centralDate( data ) {
	return data.mission_name
}

function flightNum( data ) {
	return data.flight_number
}

function rocketName( data ) {
	return data.rocket.rocket_name
}

function cargo( data ) {
	if (!data.rocket.second_stage.payloads) return "none";
	let str = ''
	for ( const payload in data.rocket.second_stage.payloads ){
		str = str + payload.payload_id
	}
	return str
}

function launchSuccess( data ) {
	return data.rocket.rocket_name
}

// ========================================

